import React from 'react';

const ReferenceItem = ({name, phone, email, relation, href}) => {
  return (
    <React.Fragment>
      {href ?
        <span className='reference__name skills-p'>{name}</span>
      :
        <span className='reference__name'>{name}</span>
      }
      <span className='reference__relation'>{relation}</span>
      <span className='reference__phone'>{phone}</span>
      <span className='reference__email'>{email}</span>
    </React.Fragment>
  );
}

export default ReferenceItem;
